                        message: "冷箱干用业务NOR（NON-OPERATING REEFER）是指使用适货的冷箱，在运输过程中不使用制冷设备运送干箱适箱货物的特殊业务。在适箱货的选择上，主要考虑对冷藏箱内衬及地板的有效保护，避免产生高额箱体及设备修理成本。所装运的货物本身及操作过程，必须不会对冷箱箱体及机组造成损坏或污染。",
                        message1: "冷箱干用的适箱货物必须至少符合如下要求：",
                        message2: "1）装箱货物及其包装为无污染、腐蚀、异味；",
                        message3: "2）货物的包装、积载及绑扎（固定）不会损坏箱体；",
                        message4: "3）货物装卸过程不会对箱体内衬及地板产生破坏；",
                        message5: "4）积载体积相对较小（20尺冷箱体积为28.4M³，是普箱箱的86%；冷高箱体积为68M³，是高箱的89%）。20尺冷箱、40尺冷高箱重量不超过设备的规范要求。",
                        message6: "以下货物严禁装运：",
                        message7: "1）危险品、化学品以及有腐蚀、有异味的货物；",
                        message8: "2）需使用铲车及类似工具装卸的货物；",
                        message9: "3）包装坚硬（如木材、金属等）的货物；",
                        message10: "4）散装货物。"
