                    message11: "9.  船公司订舱确认后将保证舱位。客户须在船公司规定时间内提空箱装柜（冷箱提箱流程同线下）、提供完整资料信息及在截关时间内完成报关进港。",
                    message12: "10. 订舱取消：",
                    message13: "1)  外贸航线（除中日、中国台湾航线）：订单生效后非因船公司原因取消订舱或货物不再出运，履约保证金不予退还。",
                    message13_lt: "1)  外贸航线：订单生效后非因船公司原因取消订舱或货物不再出运，履约保证金不予退还。",
                    message14: "2)  中日、中国台湾航线：",
                    message15: "开航前3天之前提出（含开航日）：订单生效后，非因船公司原因造成的取消订舱或货物不再出运，如有已发生费用，一并扣缴后退回余款。",
